// (c) Kallol Borah, 2020
// Stores and retrieves client KYC data stored on IPFS

pragma solidity 0.5.7;

import "../interfaces/VerifiedKYC.sol";
import "../interfaces/VerifiedClient.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";

contract Kyc is VerifiedKYC, Initializable{

    //client file for references to various KYC related data
    struct file{
        uint256 kyc_status;
        string kyc_file;
        string fatca_declaration;
        string crs_declaration; 
        string photo_id;
        string video_id;
        string address_proof;
        bytes32 country;
        bytes32 name;
        bytes32 surname;
        bytes32 phone;
        bytes32 email;
    }

    //reference of user client
    VerifiedClient private User;

    //mapping of a client to its kyc data
    mapping(address => file) private client;

    address admin;

    //event emitted for kyc acceptance status
    event KycUpdate(address indexed client, uint status);

    function initialize(address _client) public {
        User = VerifiedClient(_client);
        admin = msg.sender;
    }

    //setter and getter functions for kyc
    function setStatus(address _client, uint _status) external {
        require(msg.sender==User.getManager(_client));
        client[_client].kyc_status = _status;
        emit KycUpdate(_client, _status);
    } 

    function getStatus(address _client) external view returns(uint){
        return client[_client].kyc_status;
    }

    /*function setKyc(address _client, bytes32 _file, bytes32 _fatca, 
                    bytes32 _crs, bytes32 _photoId, bytes32 _videoId, 
                    bytes32 _address, bytes32 _country) external {
        require((msg.sender==_client || msg.sender==User.getManager(_client)));
        client[_client].kyc_file = _file;
        client[_client].fatca_declaration = _fatca;
        client[_client].crs_declaration = _crs;
        client[_client].photo_id = _photoId;
        client[_client].video_id = _videoId;
        client[_client].address_proof = _address;
        client[_client].country = _country;
    }

    function getKyc(address _client) external view returns(bytes32, bytes32, bytes32, bytes32, 
                                                            bytes32, bytes32, bytes32){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return (client[_client].kyc_file, 
                client[_client].fatca_declaration,
                client[_client].crs_declaration,
                client[_client].photo_id,
                client[_client].video_id,
                client[_client].address_proof,
                client[_client].country   
                );
    }*/

    function setFile(address _client, string calldata _file) external {
        require((msg.sender==_client || msg.sender==User.getManager(_client)));
        client[_client].kyc_file = _file;
        client[_client].kyc_status = 1;
    }

    function getFile(address _client) external view returns(string memory){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return client[_client].kyc_file;
    }

    function setFATCA(address _client, string calldata _file) external {
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        client[_client].fatca_declaration = _file;
        client[_client].kyc_status = 1;
    }

    function getFATCA(address _client) external view returns(string memory){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return client[_client].fatca_declaration;
    }

    function setCRS(address _client, string calldata _file) external {
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        client[_client].crs_declaration = _file;
        client[_client].kyc_status = 1;
    }

    function getCRS(address _client) external view returns(string memory){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return client[_client].crs_declaration;
    }

    function setPhotoID(address _client, string calldata _file) external {
        require(msg.sender==_client || msg.sender==User.getManager(_client) || msg.sender==admin);
        client[_client].photo_id = _file;
        client[_client].kyc_status = 1;
    }

    function getPhotoID(address _client) external view returns(string memory){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return client[_client].photo_id;
    }

    function setVideoID(address _client, string calldata _file) external {
        require(msg.sender==_client || msg.sender==User.getManager(_client) || msg.sender==admin);
        client[_client].video_id = _file;
        client[_client].kyc_status = 1;
    }

    function getVideoID(address _client) external view returns(string memory){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return client[_client].video_id;
    }

    function setAddress(address _client, string calldata _file) external {
        require(msg.sender==_client || msg.sender==User.getManager(_client) || msg.sender==admin);
        client[_client].address_proof = _file;
        client[_client].kyc_status = 1;
    }

    function getAddress(address _client) external view returns(string memory){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return client[_client].address_proof;
    }

    function setCountry(address _client, bytes32 _country) external {
        require(msg.sender==_client || msg.sender==User.getManager(_client) || msg.sender==admin);
        client[_client].country = _country;
        client[_client].kyc_status = 1;
    }

    function getCountry(address _client) external view returns(bytes32){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return client[_client].country;
    }

    function setName(address _client, bytes32 _name, bytes32 _surname) external {
        require(msg.sender==_client || msg.sender==User.getManager(_client) || msg.sender==admin);
        client[_client].name = _name;
        client[_client].surname = _surname;
        client[_client].kyc_status = 1;
    }

    function getName(address _client) external view returns(bytes32, bytes32){
        //require(msg.sender==_client || msg.sender==User.getManager(_client));
        return (client[_client].name, client[_client].surname);
    }

    function setPhone(address _client, bytes32 _phone) external {
        require(msg.sender==_client || msg.sender==User.getManager(_client) || msg.sender==admin);
        client[_client].phone = _phone;
        client[_client].kyc_status = 1;
    }

    function getPhone(address _client) external view returns(bytes32){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return client[_client].phone;
    }    

    function setEmail(address _client, bytes32 _email) external {
        require(msg.sender==_client || msg.sender==User.getManager(_client) || msg.sender==admin);
        client[_client].email = _email;
        client[_client].kyc_status = 1;
    }

    function getEmail(address _client) external view returns(bytes32){
        require(msg.sender==_client || msg.sender==User.getManager(_client));
        return client[_client].email;
    }   

}
